        file: {
          url: img2
        }
      }
    },
    {
      fields: {
        file: {
          url: img2
        }
      }
    }
  ]
function App() {
    return (
        <div className="slide-container">
        <Slide scale={0.4}>
        
          {images.map((item, index) => (
            <img key={index} src={item.file.url}  width="600px" />
          ))}
          
          </Slide>
          </div>
    )
}
export default App;
